  const toggleSignIn = () => {
      setSignInOpen(!SignInOpen);
    }
  return (
    <div>
        <LoginL onClick={toggleSignIn}/>
        {SignInOpen &&(<OpenedSignIn/>)}
    </div>
  ) 
}
